gement led me to study the performing arts at an incredible college.</span></p></div></div></div><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-5z c1-2p c1-69 c1-6a c1-t c1-3b c1-6b c1-v c1-6c c1-b c1-c c1-7p c1-7q c1-6d c1-6e c1-6f c1-6g c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="ContentCard" data-field-id="cards" data-field-route="/card/1" index="1" id="42380399-513e-4df2-ac6d-0bf9414fd782" class="x-el x-el-div x-el c1-1 c1-2 c1-2b c1-30 c1-2c c1-1z c1-2d c1-4 c1-6h c1-6i c1-6j c1-b c1-c c1-6k c1-6l c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route"><h4 typography="HeadingDelta" data-ux="ContentCardHeading" data-aid="ABOUT_HEADLINE_RENDERED1" data-field-id="cards.headline" data-field-route="/card/1" class="x-el x-el-h4 c1-1 c1-2 c1-1i c1-1j c1-6m c1-1v c1-1w c1-1x c1-1y c1-6n c1-6o c1-6p c1-v c1-b c1-20 c1-6q c1-45 c1-6r c1-6s c1-6t c1-6u x-d-ux x-d-aid x-d-field-id x-d-field-route">My Favorite Work</h4><div typography="BodyAlpha" data-ux="ContentCardText" data-aid="ABOUT_DESCRIPTION_RENDERED1" data-field-id="cards.description" data-field-route="/card/1" class="x-el x-el-p c1-1 c1-2 c1-1i c1-1j c1-6v c1-1x c1-1y c1-6w c1-6x c1-6y c1-6z c1-70 c1-71 c1-72 c1-73 c1-74 c1-75 c1-76 c1-77 c1-78 c1-79 c1-7a c1-7b c1-7c c1-7d c1-7e c1-7f c1-7g c1-7h c1-7i c1-7j c1-7k c1-7l c1-7m c1-7n c1-b c1-7o c1-c c1-45 c1-d c1-e c1-f c1-g x-d-ux x-d-aid x-d-field-id x-d-field-route x-rt"><p style="margin:0"><span>At the end of the day, the work I enjoy the most is when the audience feels connected to my performance. There's nothing worse than an audience that doesn't react to you and just watches passively.&nbsp;</span></p></div></div></div><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-5z c1-2p c1-69 c1-6a c1-t c1-3b c1-6b c1-v c1-6c c1-b c1-c c1-7p c1-7q c1-6d c1-6e c1-6f c1-6g c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="ContentCard" data-field-id="cards" data-field-route="/card/2" i